    false,nt"url": null,nt"notes": "This dataset contains wellheader features
    compiled by the Arizona Geological Survey, and published as a Web feature service
    for the National Geothermal Data System. Fields in the Wellheader Feature Content
    Model will become XML elements in interchange documents for WMS simple features
    provided by a node in the USGIN network.  Each observation includes a WellName,
    WellType, Latitude and Longitude spatially referenced to EPSG: 4326 (for interoperability).
